import React,{Component} from "react";

class ToDoApp extends Component{
    render(){
        return (
            <div>
                <LoginComponent />
            </div>
        )
    }
}

class LoginComponent extends Component {
constructor(){
    super();
    this.state = {
            username : "in28minutes",
            password : ""
    }
    this.handleUserChange = this.handleUserChange.bind(this);
    this.handlePasswordChange = this.handlePasswordChange.bind(this);
}

handleUserChange(event){
    this.setState(
        {username : event.target.value}
    )
}
handlePasswordChange(event){
    this.setState(
        {password : event.target.value}
    )
}

    render(){
        return (
            <div>
                Username : <input type="text" name="username" value={this.state.username} onChange={this.handleUserChange} /><br/>
                Password : <input type="password" name="password" value={this.state.password} onChange={this.handlePasswordChange}/><br/>
                <button>Login</button>
            </div>
        )
    }
}

export default ToDoApp;
